-- Главная таблица проекта - хранит в себе все посты в блоге
create table if not exists post (
    post_id bigint auto_increment PRIMARY KEY,
    title VARCHAR(512) NOT NULL,
    picture_base_64 clob,
    content clob
);
create table if not exists comment (
    comment_id bigint auto_increment PRIMARY KEY,
    content varchar(1024),
    post_id bigint,
    foreign key (post_id) references post(post_id)
);
create table if not exists likes (
    like_id bigint auto_increment PRIMARY KEY,
    post_id bigint,
    foreign key (post_id) references post(post_id)
);

insert into post(title, picture_base_64, content) values (
    'Городские парки наполняются цветами благодаря усилиям волонтеров',
    '',
    'В минувшие выходные группа местных волонтеров собрала более 100 человек, чтобы преобразить парковую зону в центре города. Организация "Зеленые сердца" инициировала проект по озеленению общественных пространств, привлекая жителей и предпринимателей к уходу за природой.
    Участники мероприятия высадили более 300 цветущих растений и деревьев, а также организовали мастер-классы по садоводству для детей. Каждый желающий смог принять участие в посадке и научиться, как заботиться о растениях.
    Инициатива вызвала большой отклик среди жителей. Местные кафе и магазины поддержали проект, предоставив сладости и напитки для волонтеров. Организаторы надеются, что это мероприятие стало первым шагом к созданию более зеленого и уютного города для всех его жителей.'
);
insert into post (title, picture_base_64, content) VALUES (
    'Школы города запускают программу обмена книгами для детей',
    '',
    'В рамках новой инициативы, поддерживаемой городской администрацией, в школах города стартует программа обмена книгами под названием "Читай и делись". Главная цель проекта – привить детям любовь к чтению и расширить их кругозор.
    В каждой школе будут специально оборудованные уголки для обмена литературой, где ученики смогут оставить свои прочитанные книги и взять другие. Педагоги планируют проводить регулярные мероприятия, на которых дети смогут обсуждать прочитанные произведения и рекомендовать их своим сверстникам.
    Программа уже вызвала интерес у родителей и педагогов, а также получила поддержку от местных библиотек, которые предложили участвовать в организации тематических встреч и чтений. Участники проекта уверены, что это поможет создать дружелюбную атмосферу и укрепить сообщество любителей книг в городе.'
);
insert into post (title, picture_base_64, content) values (
    'Неправительственная организация проводит фестиваль дружбы среди молодежи',
    '',
    'В минувшие выходные в парке "Солнечный свет" состоялся яркий фестиваль дружбы, организованный местной неправительственной организацией "Мир вместе". Мероприятие собрало более 500 молодых людей, желающих познакомиться, обменяться опытом и найти новых друзей.

    Фестиваль включал разнообразные активности: спортивные соревнования, мастер-классы по танцам, кулинарные мастер-классы и музыкальные выступления местных исполнителей. Участники смогли попробовать блюда кухонь разных стран, а также поучаствовать в создании совместного художественного проекта, символизирующего единство и толерантность.

    Организаторы выразили надежду, что такие мероприятия помогут молодым людям общаться и строить дружеские отношения вне зависимости от культурных различий. В заключение, фестиваль завершился красочным концертом, который собрал горячие аплодисменты и положительные эмоции у всех гостей.'
);
